    width:15rem;
}
.nouv_classicPopin .nouv_buttons
{
    height:0;
    overflow:hidden;
    transition: height .5s ease-out;
}
.nouv_classicPopin.reduite .nouv_buttons
{
    height:0;
}
.nouv_classicPopin .nouv_buttons
{
    height:11rem;
}
.nouv_classicPopin .nouv_second
{
    margin-top:1rem;
    font-size:.875rem;
}
.nouv_carousel .nouv_belowPopin, .nouv_classicPopin .nouv_belowPopin
{
    position:absolute;
    width:100%;
    top: 100%;
    left:0;
    margin-top:.5rem;
    font-size:.875rem;
}

button.nouv_buttonAsLink
{
    border:none;
    background: none;
    cursor:pointer;
   font-size:1em;
}
button.nouv_buttonAsLink.-nouv_white
{
    color:white;
}
.nouv_classicPopin img.illustration
{
    max-width:100%;
    max-height:12rem;
}
button.btn_croix
{
    background:none;
}
button.btn_croix img
{
  width: 1rem;
  height: 1rem;
}
span.nouv_underline
{
    text-decoration:underline;
}
div#nouv_popin_modal_overlay
{
    position: fixed;
    display: table;
    z-index: 99;
    top: 0;    
    left: 0;
    width:100%;
    height:100%;    
    background-color: rgba(0,0,0,.6);
}
div#nouv_popin_modal_overlay .nouv_container
{
    display:table-cell;
    vertical-align: middle;
    text-align: center
}


.nouv_carousel
{
    display:inline-block;
    position:relative;
}
.nouv_carousel .nouv_center_popin
{
    transform:scale(1);
    z-index:101;
    filter: brightness(1);
}
.nouv_carousel .nouv_right_popin, .nouv_carousel .nouv_left_popin
{
    position: absolute;
    top:0;
    left:0;
    z-index:100;
    cursor: pointer;
}
.nouv_carousel .nouv_right_popin
{
    transform:translateX(50%) scale(.9);
    filter:brightness(.8);
}
.nouv_carousel .nouv_left_popin
{
    transform:translateX(-50%) scale(.9);
    filter:brightness(.8);
}
.nouv_classicPopin.nouv_right_popin h2
{
    text-align: right;
    font-size:2rem;
}
.nouv_classicPopin.nouv_left_popin h2
{
    text-align: left;
    font-size:2rem;
}
.nouv_carousel .nouv_classicPopin
{
    transition: transform .5s ease-in;
}
.nouv_carousel .nouv_classicPopin .nouv_belowPopin
{
    display:none;
}
.dcw_btn.dcw_btn--primary.nouv_first:focus {
    border: .125rem solid #f05b6f;
    background-color: #f05b6f;
}
.dcw_btn.dcw_btn--primary.nouv_first:hover {
    border: .125rem solid #ee425b;
    background-color: #ee425b;
}</style>
